import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { HTTP_INTERCEPTORS, HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';
import { DialogModule } from 'primeng/dialog';
import { AppComponent } from './app.component';
import { NavMenuComponent } from './nav-menu/nav-menu.component';
import { UrlsTableComponent } from './urls-table/urls-table.component';
import { LoginComponent } from './login/login.component';
import { NgxWebstorageModule } from 'ngx-webstorage';
import { NgxPermissionsModule } from 'ngx-permissions';
import { LogoutComponent } from './logout/logout.component';
import { MainPageComponent } from './main-page/main-page.component';
import { MyUrlsPageComponent } from './my-urls-page/my-urls-page.component';
import jwtDecode from 'jwt-decode';
import { JwtInterceptor } from './services/jwt.interceptor';
import { JwtModule } from '@auth0/angular-jwt';

@NgModule({
  declarations: [
    AppComponent,
    NavMenuComponent,
    UrlsTableComponent,
    LoginComponent,
    MainPageComponent,
    MyUrlsPageComponent,
    HttpClientModule,
    PaginatorModule,
    DynamicDialogModule,
    ConfirmPopupModule,
    BrowserAnimationsModule,
    DialogModule,
    
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    DialogModule,
    JwtModule,
    NgxPermissionsModule.forRoot(),
    NgxWebstorageModule.forRoot(),
    RouterModule.forRoot([
      { path: '', component: MainPageComponent, pathMatch: 'full' },
      { path: 'login', component: LoginComponent },
      { path: 'logout', component: LogoutComponent },
      { path: 'my', component: MyUrlsPageComponent },
      //{ path: 'info', component: LogoutComponent },
    ])
  ],
  providers: [
    {
      provide: HTTP_INTERCEPTORS,
      useClass: JwtInterceptor,
      multi: true,
    }
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
